    /**
     * @param $name
     */
    public function __construct($name = null)
    {
        parent::__construct($name);
    }

    /**
     * @return void
     */
    protected function configure()
    {
        $this->setName('istruttoria:generaIstruttoria')->setDescription('');
        $this->addArgument('id_bando', InputArgument::REQUIRED, 'tipo di risorsa da trasmettere');
    }

    /**
     * @param InputInterface $input
     * @param OutputInterface $output
     * @return void
     * @throws SfingeException
     */
    protected function execute(InputInterface $input, OutputInterface $output)
    {
        $id_bando = $input->getArgument('id_bando');
        $this->em = $this->getContainer()->get('doctrine.orm.entity_manager');
        if ($id_bando != 171 && $id_bando != 170) {
            $output->writeln("<comment>Funzione al momento disponibile solo per procedure 170 e 171</comment>");
            exit(0);
        }
        if ($id_bando == 171) {
            $richieste = $this->em->getRepository("RichiesteBundle\Entity\Richiesta")->findById($this->getAmmessi171());
        } elseif ($id_bando == 170) {
            $richieste = $this->em->getRepository("RichiesteBundle\Entity\Richiesta")->findById($this->getAmmessi170());
        } else {
            $richieste = $this->em->getRepository("RichiesteBundle\Entity\Richiesta")->getRichiesteInoltrateProcedura($id_bando);
        }
        foreach ($richieste as $richiesta) {
            $this->aggiornaIstruttoriaRichiesta($richiesta->getId(), $output);
        }
    }

    /**
     * @param $id_richiesta
     * @param OutputInterface $output
     * @return IstruttoriaRichiesta|null
     * @throws SfingeException
     * @throws Exception
     */
    public function aggiornaIstruttoriaRichiesta($id_richiesta, OutputInterface $output): ?IstruttoriaRichiesta
    {
        /** @var Richiesta $richiesta */
        $richiesta = $this->em->getRepository('RichiesteBundle:Richiesta')->find($id_richiesta);
        $procedura_id = $richiesta->getProcedura()->getId();
        if (is_null($richiesta)) {
            throw new SfingeException('Risorsa non trovata');
        }
        $istruttoria = $richiesta->getIstruttoria();
        if (is_null($istruttoria)) {
            $istruttoria = new IstruttoriaRichiesta();
            $istruttoria->setSospesa(false);
            $istruttoria->setRichiesta($richiesta);
            $richiesta->setIstruttoria($istruttoria);
        }

        if (in_array($id_richiesta, $this->getAmmessi171())) {
            $istanzaFascicolo = $richiesta->getPrimoOggetto()->getIstanzaFascicolo();
            $servizioIstanzaFascicolo = $this->getContainer()->get("fascicolo.istanza");
            $contributoRichiesto = (float) $servizioIstanzaFascicolo->getOne($istanzaFascicolo, 'bando_montagna_2022_171.indice.sezione_contributo_e_annualita_di_rendicontazione.form_contributo.contributo_richiesto');

            // Creazione piano dei costi presentazione
            $this->creaPianoDeiCostiPresentazione($richiesta, $contributoRichiesto);

            $atto = $this->em->getRepository("SfingeBundle\Entity\Atto")->findOneById(1007);
            $utenteValidatore = $this->em->getRepository("SfingeBundle\Entity\Utente")->findOneByUsername('FRNSFN67S21F205X');
            $esito = $this->em->getRepository("IstruttorieBundle\Entity\EsitoIstruttoria")->findOneBy(array('codice' => 'AMMESSO'));
            $istruttoria->setEsito($esito);
            $istruttoria->setCostoAmmesso($contributoRichiesto);
            $istruttoria->setContributoAmmesso($contributoRichiesto);
            $istruttoria->setImpegnoAmmesso($contributoRichiesto);
            $istruttoria->setAmmissibilitaAtto(true);
            $istruttoria->setConcessione(true);
            $istruttoria->setDataContributo(new \DateTime('2022-12-05'));
            $istruttoria->setDataImpegno(new \DateTime('2022-12-05'));
            $istruttoria->setAttoAmmissibilitaAtc($atto);
            $istruttoria->setAttoConcessioneAtc($atto);
            $istruttoria->setDataAvvioProgetto(new \DateTime('2022-08-01'));
            $istruttoria->setDataTermineProgetto(new \DateTime('2023-09-05'));
            $istruttoria->setDataInizioVincolante(true);
            $istruttoria->setTipologiaSoggetto('PRIVATO');
            $istruttoria->setValidazioneAtc(true);
            $istruttoria->setUtenteValidatoreAtc($utenteValidatore);
            $istruttoria->setDataValidazioneAtc(new \DateTime());

            // Creazione piano dei costi istruttoria
            $this->creaPianoDeiCostiIstruttoria($richiesta, $contributoRichiesto);

            if (is_null($richiesta->getAttuazioneControllo())) {
                $atc = $this->generaATC($istruttoria);
                $richiesta->setAttuazioneControllo($atc);
            } else {
                $atc = $richiesta->getAttuazioneControllo();
            }
            $servizioMonitoraggio = $this->getContainer()->get("gestore_istruttoria");
            $servizioMonitoraggio->getGestore($richiesta->getProcedura())->aggiungiInformazioniMonitoraggio($richiesta);
            $this->em->persist($richiesta);

            $this->creaLogIstruttoriaAtc($istruttoria, 'ATC_VALIDA', $utenteValidatore);
        }

        if (in_array($id_richiesta, $this->getAmmessi170())) {
            $atto_ammissibilita = $this->em->getRepository("SfingeBundle\Entity\Atto")->findOneById($this->dati170[$id_richiesta]['atto_ammissibilita']);
            $atto_concessione = $this->em->getRepository("SfingeBundle\Entity\Atto")->findOneById($this->dati170[$id_richiesta]['atto_concessione']);
            $utenteValidatore = $this->em->getRepository("SfingeBundle\Entity\Utente")->findOneByUsername('ZPPMCR67S54A944B');
            $esito = $this->em->getRepository("IstruttorieBundle\Entity\EsitoIstruttoria")->findOneBy(array('codice' => 'AMMESSO'));
            $istruttoria->setEsito($esito);
            $istruttoria->setCodiceCup($this->dati170[$id_richiesta]['CUP']);
            $istruttoria->setCostoAmmesso((float) ($this->dati170[$id_richiesta]['A']));
            $istruttoria->setContributoAmmesso((float) ($this->dati170[$id_richiesta]['B']));
            $istruttoria->setImpegnoAmmesso((float) ($this->dati170[$id_richiesta]['B']));
            $istruttoria->setAmmissibilitaAtto(true);
            $istruttoria->setConcessione(true);
            $istruttoria->setDataContributo(new \DateTime($this->dati170[$id_richiesta]['data_contributo_concesso']));
            $istruttoria->setDataImpegno(new \DateTime($this->dati170[$id_richiesta]['data_impegno']));
            $istruttoria->setAttoAmmissibilitaAtc($atto_ammissibilita);
            $istruttoria->setAttoConcessioneAtc($atto_concessione);
            $istruttoria->setDataAvvioProgetto(new \DateTime($this->dati170[$id_richiesta]['data_inizio_progetto']));
            $istruttoria->setDataTermineProgetto(new \DateTime($this->dati170[$id_richiesta]['data_termine_progetto']));
            $istruttoria->setDataInizioVincolante(true);
            $istruttoria->setTipologiaSoggetto('PUBBLICO');
            $istruttoria->setValidazioneAtc(true);
            $istruttoria->setUtenteValidatoreAtc($utenteValidatore);
            $istruttoria->setDataValidazioneAtc(new \DateTime());
            //Per sto bando servono i dati cup

            $nature = $this->em->getRepository("CipeBundle\Entity\Classificazioni\CupNatura")->findOneBy(array("codice" => "06"));
            $tipologie = $this->em->getRepository("CipeBundle\Entity\Classificazioni\CupTipologia")->findOneBy(array("codice" => "99", "CupNatura" => '06'));
            $settori = $this->em->getRepository("CipeBundle\Entity\Classificazioni\CupSettore")->findOneBy(array("codice" => "05"));
            $sottosettori = $this->em->getRepository("CipeBundle\Entity\Classificazioni\CupSottosettore")->findOneBy(array("codice" => "11", "CupSettore" => '05'));
            $categorie = $this->em->getRepository("CipeBundle\Entity\Classificazioni\CupCategoria")->findOneBy(array("codice" => array("097"), "CupSottosettore" => '11'));
            $istruttoria->setCupNatura($nature);
            $istruttoria->setCupTipologia($tipologie);
            $istruttoria->setCupSettore($settori);
            $istruttoria->setCupSottosettore($sottosettori);
            $istruttoria->setCupCategoria($categorie);

            if (is_null($richiesta->getAttuazioneControllo())) {
                $atc = $this->generaATC($istruttoria);
                $richiesta->setAttuazioneControllo($atc);
            } else {
                $atc = $richiesta->getAttuazioneControllo();
            }
            $servizioMonitoraggio = $this->getContainer()->get("gestore_istruttoria");
            $servizioMonitoraggio->getGestore($richiesta->getProcedura())->aggiungiInformazioniMonitoraggio($richiesta);
            $this->em->persist($richiesta);

            $this->creaLogIstruttoriaAtc($istruttoria, 'ATC_VALIDA', $utenteValidatore);
        }

        $this->em->persist($istruttoria);

        $this->avanzaFaseIstruttoriaRichiesta($istruttoria);
        if ($procedura_id != 171) {
            if ($procedura_id == 170) {
                $this->istruttoriaPianoCostiProponente170($richiesta->getMandatario());
            } else {
                $this->istruttoriaPianoCostiProponente($richiesta->getMandatario());
            }
        }
        try {
            $this->em->flush();
        } catch (\Exception $e) {
            $output->writeln("<comment>Errore nell'aggiornamento dell'istruttoria:" . $e->getMessage() . "</comment>");
        }

        return $istruttoria;
    }

    /**
     * @param $istruttoria_richiesta
     * @return void
     */
    public function avanzaFaseIstruttoriaRichiesta($istruttoria_richiesta)
    {
        $fase_successiva = $this->em->getRepository('IstruttorieBundle:FaseIstruttoria')->findFaseSuccessiva($istruttoria_richiesta);

        if (!is_null($fase_successiva)) {
            $istruttoria_richiesta->setFase($fase_successiva);
            $this->operazioniAvanzamentoFase($istruttoria_richiesta, $fase_successiva);
        }
    }

    /**
     * @param Richiesta $richiesta
     * @param float $contributoRichiesto
     * @return void
     * @throws Exception
     */
    public function creaPianoDeiCostiPresentazione(Richiesta $richiesta, float $contributoRichiesto)
    {
        $proponente = $richiesta->getMandatario();
        $vociPiano = $this->em->getRepository("RichiesteBundle:PianoCosto")
            ->getVociDaProcedura($richiesta->getProcedura()->getId());

        try {
            foreach ($vociPiano as $vocePiano) {
                $voce = new VocePianoCosto();
                $voce->setImportoAnno1($contributoRichiesto);
                $voce->setPianoCosto($vocePiano);
                $voce->setProponente($proponente);
                $voce->setRichiesta($richiesta);
                $proponente->addVociPianoCosto($voce);
                $richiesta->addVociPianoCosto($voce);
                $this->em->persist($voce);
            }
            $this->em->persist($proponente);
        } catch (Exception $e) {
            throw new Exception('Errore nella creazione del Piano dei Costi di presentazione');
        }
    }

    /**
     * @param Richiesta $richiesta
     * @param float $contributoRichiesto
     * @return void
     * @throws Exception
     */
    public function creaPianoDeiCostiIstruttoria(Richiesta $richiesta, float $contributoRichiesto)
    {
        $proponente = $richiesta->getMandatario();
        $proponente->ordinaVociPianoCosto();
        $voci_piano_costo = $proponente->getVociPianoCosto();

        foreach ($voci_piano_costo as $voce_piano_costo) {
            if (is_null($voce_piano_costo->getIstruttoria())) {
                $istruttoria = new IstruttoriaVocePianoCosto();
                $istruttoria->setVocePianoCosto($voce_piano_costo);
                $voce_piano_costo->setIstruttoria($istruttoria);
                $istruttoria->setImportoAmmissibileAnno1($contributoRichiesto);
            }
        }
    }

    /**
     * @param $istruttoria_richiesta
     * @param $fase
     * @return void
     */
    public function operazioniAvanzamentoFase($istruttoria_richiesta, $fase)
    {
        if (!is_null($fase->getChecklist())) {
            foreach ($fase->getChecklist() as $checklist) {
                $gestore = $this->getContainer()->get('gestore_checklist')->getGestore($istruttoria_richiesta->getRichiesta()->getProcedura());
                $gestore->genera($istruttoria_richiesta, $checklist);
            }
        }
    }

    /**
     * @param $id_proponente
     * @return void
     */
    public function istruttoriaPianoCostiProponente($id_proponente)
    {
        /** @var Proponente $proponente */
        $proponente = $this->em->getRepository("RichiesteBundle:Proponente")->find($id_proponente);

        $proponente->ordinaVociPianoCosto();
        $voci_piano_costo = $proponente->getVociPianoCosto();
        $this->generaIstruttorieVociPianoCosto($voci_piano_costo);
    }

    public function istruttoriaPianoCostiProponente170($id_proponente)
    {
        /** @var Proponente $proponente */
        $proponente = $this->em->getRepository("RichiesteBundle:Proponente")->find($id_proponente);

        $proponente->ordinaVociPianoCosto();
        $voci_piano_costo = $proponente->getVociPianoCosto();
        $this->generaIstruttorieVociPianoCosto170($voci_piano_costo, $proponente->getRichiesta()->getId());
    }

    /**
     * @param $voci_piano_costo
